import './App.css';
import Post from "./Post.js";
import Header from "./Header.js";
import Layout from "./Layout.js";
import {Route, Routes} from "react-router-dom";

function App() {
  return (
    <div>
    <Routes>
      <Route path="/" element={<Layout />}>



      </Route>

      <Route path={'/login'} element={  
          <div>Login Page</div>
      }>

      </Route>
    </Routes>
    </div>
  );
}

export default App;
